		<header class="entry-header">
		<h1 class="entry-title">Округу знайомства в Житомир Україна</h1><!-- .entry-meta -->
			</header><!-- .entry-header -->



	<div class="entry-content">

<p>
<p>Нині ж Борислав Розенблат знову в списку кандидатів у народні депутати від Житомира. Під час виборчого процесу в окрузі спостерігається значна активність кандидатів та представників політичних сил. Прослідковується тенденція дочасного старту агітації. Лідери політичних партій активно нагадували про себе через зовнішню рекламу.</p>
<p>Політки агітували через намети, друковану продукцію, безкоштовні акції, послуги, солодкі подарунки з партійною символікою, організовували безкоштовні екскурсії, кіноперегляди, відвідували організації та установи і вітали зі святами. У день голосування на виборах Президента України 31 березня були зафіксовані такі інциденти з ознаками порушення виборчого законодавства: видача бюлетеня без паспорта, нестача кабінок та скриньок для голосування, порушення таємниці голосування.</p>
<p>Всього було зафіксовано понад 60 повідомлень  по області. У день повторного голосування 21 квітня спостерігачі ОПОРИ в області фіксували схожі порушення. Всього було зафіксовано понад 50 повідомлень про інциденти. По Житомиру станом на 25 червня зафіксовано понад сітілайтів та білбордів зареєстрованих кандидатів та партій, які не містять інформацію про установу, яка здійснила друк, їх тираж, інформацію про осіб, відповідальних за випуск, та замовника відповідних матеріалів.</p>
<p>Потенційно, виготовлення такої  агітації фінансувалося не з виборчого фонду, адже значна частина таких матеріалів розміщена до відкриття самих фондів партій чи реєстрації кандидатів. Найбільше по місту матеріалів з написами  «Лідерство це відповідальність. Гройсман», «Українська стратегія Володимир Гройсман». Виборчий список партії «Українська стратегія Володимира Гройсмана» Центральна виборча комісія зареєструвала 21 червня. Також виявлені білборди із зображенням Петра Порошенка та гаслами «Обирай НАТО і ЄС. Європейська солідарність», «Захистимо Європейське майбутнє України.</p>
<p>Європейська солідарність». Про такі випадки спостерігачі ОПОРИ поінформували поліцію та подали 14 заяв. Також в окрузі є «постійні» кандидати, які балотуються на всіх виборах. Є ще що розвивати. Є люди, яким все рівно від якого округу, аби потрапити у Верховну Раду немає значення чи це Житомир, чи Кривий Ріг чи Бердичів. У нас є постійні кандидати, які балотуються майже на всіх виборах: в мери, в міську раду, в народні депутати. Любов Цимбалюк почала активно з року балотуватися, от вже зареєстрована за принципом самовисування.</p><strong><a id='y1'></a><h2>Відкритий реєстр юридичних осіб, без капчі та реєстрації</h2></strong><p>Ще деякі житомиряни обирають 67 округ, бо туди входить частина Житомира і вони балотуються, але я не пам'ятаю ще жодного разу за останні три-чотири каденції, щоб хтось переміг Развадовського. Всі забувають, що крім частини Житомира там ще є райони, в яких житомиряни не бувають, їх там не знають, можливо  по Житомиру вони нормально набирають голосів, але за рахунок районів, вони не можуть виграти по цьому округу», — вважає Тамара Коваль. Станом на 25 червня до Верховної Ради від Житомира балотуються 14 кандидатів-мажоритарників.</p>
<p>З них — дві жінки, які є депутатками Житомирської міської ради — Любов Цимбалюк донедавна очолювала в міськраді фракцію ВО «Батьківщина» балотується шляхом самовисування та Наталія Леонченко, голова фракції «Опозиційний блок» балотується від партії «Опозиційна платформа — за життя». Всі інші 11 кандидатів — самовисуванці. Серед них чинний народний депутат Борислав Розенблат та колишній голова обласної державної адміністрації Ігор Гундич, якого президент Володимир Зеленський звільнив з посади   24 червня. А також представники медичної сфери Анатолій Пешко та Віктор Борщівський, підприємці Олег Грамотенко, Антон Герговський, Борис Ткаченко, колишній начальник управління ДАІ УМВС в Житомирській області Володимир Недільський, активіст Олександр Коцюбко та депутат Богунської районної ради Микола Череднік.</p>
<p>Кандидати ведуть активну діяльність, організовують концерти, зустрічі з виборцями, дарують подарунки, встановлюють дитячі майданчики. У свою чергу виборці «звикли» до таких форм агітації, але з кожними виборами збільшується  кількість звернень до представників ОПОРИ та правоохоронних органів щодо ймовірного порушення виборчого законодавства.</p>
<p>Такі свідомі вчинки виборців забезпечують прозорість та законність виборів в окрузі. Довідково: Спостереження ОПОРИ спрямоване на незаангажовану оцінку процесу підготовки та проведення виборів, сприяння чесним та вільним виборам, попередження порушень. Громадянська мережа ОПОРА проводить масштабну кампанію спостереження за позачерговими виборами до Верховної Ради.</p><strong><a id='y2'></a><h2>Рішення № 89708666, 29.05.2021, Богунський районний суд м. Житомира</h2></strong><p>З моменту офіційного старту виборчої кампанії до спостереження залучено спостерігачі по всій країні. А в день голосування 21 липня року до них долучаться ще понад 1 спостерігачів. Вони також здійснюватимуть паралельний підрахунок голосів PVT — parallel vote tabulation з метою отримання результатів виборів, що будуть набагато швидші за офіційні та точніші за екзит-поли.</p><img src="https://img01.obyava.ua/classified/0/1362/3820/200-yvtqg445xzcfa4t9.jpg" alt="Проститутки пермь номер телефона" style="max-width: 480px; max-height: 480px;"/><p>Крім того, ми моніторимо використання бюджетних ресурсів у цілях непрямої агітації, навчаємо правоохоронні органи щодо особливостей виборчого процесу, запустили мережу громадських омбудсменів із захисту виборчих прав громадян, оцінили виконання Україною рекомендацій міжнародних місій щодо виборчої реформи та займаємося просвітою виборців. UA EN UA. Статті Анонси Блоги Заяви Звіти Новини Підкатегорія Парламентські вибори Вибори навиворіт Виборчі омбудсмени Дезінформація Діяльність партій Міжнародні Місцеві вибори Політична реклама Президентські вибори Референдум Історія української демократії Підкатегорія Парламентські вибори Вибори округ.</p>
